import WebpayPlus from '.';
import RequestService from '../../common/request_service';
import Transaction from './transaction';
import { CaptureRequest } from './requests';
const DeferredTransaction = Object.assign(Object.assign({}, Transaction), { capture: async (token, buyOrder, authorizationCode, amount, options = WebpayPlus.getDefaultOptions()) => {
        return RequestService.perform(new CaptureRequest(token, buyOrder, authorizationCode, amount), options);
    } });
export default DeferredTransaction;
